function Headers(props) {
    return (
        <head>
            <meta http-equiv="content-type" content="text/html" charset="utf-8"/>
            <title>{props.title}</title>
            <link rel="apple-touch-icon" href="../.next/static/images/favicon.ico" />
        </head>
    )
}

export default Headers
